import React, { useContext, useEffect, useState } from "react";
import { Context } from "../hooks/context.js";
import axios from "axios";
import { Card, Button } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import ListaEventos from "./listaEventos.js";
import EditEvento from "./editEvento.js";
const Principal = () => {
  const [edit, setEdit] = useState(false);
  const editaroLista = () => {
    console.log(edit);
    if (edit) {
      return (
        <Context.Provider value={[edit, setEdit]}>
          <EditEvento />
        </Context.Provider>
      );
    } else {
      return (
        <Context.Provider value={[edit, setEdit]}>
          <ListaEventos />
        </Context.Provider>
      );
    }
  };
  return <div>{editaroLista()}</div>;
};
export default Principal;
